import React from "react";
import './nav.css';
import { Link } from "react-router-dom";

 const NavBar = () => {
  return (
    <nav className="caja-de-navbar">
            <ul className="botones"><Link to="/"><h2>Pokedex</h2></Link></ul>
            <ul><Link to="/create">Create</Link></ul>
            <ul><Link to="/team">My team</Link></ul>
      
    </nav>
  );
};
export default NavBar;
